import React from 'react';
import CompHour from './CompHour';
import CompMin from './CompMin';
import CompSec from './CompSec';

const CompClock = () => {
  return (
    <div className='clock pin'>
      <CompHour/>
      <CompMin/>
      <CompSec/>
      
    </div>
  );
};

export default CompClock;
